import React from "react";
import ToyDisplay from "./toysDisplay";
import toys from "../toys.js";

function ToyDisplayBodyWrapper(props) {
  return (
    <div className="container">
        <div className="row">
            {toys.map(toy =>       
                <ToyDisplay
                key={toy.id}
                image={toy.image}
                cost={toy.cost}
                />
            )}
        </div>
    </div> 
  );
}

export default ToyDisplayBodyWrapper;
